import React, { useState } from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    // Header Navbar Compnent
    <header className="header">
      <div className="navbar">
        <div className="logo">
          <Link to="/">
            {/* <img src={} alt="Logo" /> */}
            <h2>Poke Pedia</h2>
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
